import React from 'react';
import { 
  Navbar, 
  NavbarBrand, 
  Nav, 
  NavItem, 
  NavLink, 
  Container 
} from 'reactstrap';
import { Link } from 'react-router-dom';
import { 
  Home, 
  Info, 
  Settings 
} from 'react-feather';

const MyNavbar = () => {
  return (
    <Navbar 
      dark 
      expand="md" 
      className="py-3" 
      style={{ 
        backgroundColor: '#1E3A23', 
        boxShadow: '0 4px 6px rgba(0,0,0,0.1)' 
      }}
    >
      <Container fluid="lg">
        <NavbarBrand 
          href="/" 
          className="d-flex align-items-center"
          style={{ 
            fontWeight: 600, 
            letterSpacing: '1px', 
            fontSize: '1.5rem' 
          }}
        >
          <img 
            src="public/logo192.png" 
            alt="Logo" 
            style={{ 
              height: '40px', 
              marginRight: '10px' 
            }} 
          />
          Mi App
        </NavbarBrand>
        <Nav className="ms-auto" navbar>
          <NavItem className="mx-2">
            <NavLink 
              tag={Link} 
              to="/" 
              className="d-flex align-items-center"
            >
              <Home className="me-2" size={20} />
              Home
            </NavLink>
          </NavItem>
          <NavItem className="mx-2">
            <NavLink 
              tag={Link} 
              to="/about" 
              className="d-flex align-items-center"
            >
              <Info className="me-2" size={20} />
              About
            </NavLink>
          </NavItem>
          <NavItem className="mx-2">
            <NavLink 
              tag={Link} 
              to="/services" 
              className="d-flex align-items-center"
            >
              <Settings className="me-2" size={20} />
              Services
            </NavLink>
          </NavItem>
        </Nav>
      </Container>
    </Navbar>
  );
};

export default MyNavbar;
